import styled from "styled-components";

const Nav = styled.nav`
    width: 100%;
    padding: 10px 50px;

    background: transparent;

    color: #F2F5F8;
`;

const UList = styled.ul`
    display: flex;
    align-items: center;
    justify-content: center;

    gap: 10px;

    list-style: none;
`;

const listElement = styled.li`
    text-decoration: none;

    &:hover {
        color: #F7257D;
    }
`;
